import axios from "axios"

const baseURL = "http://localhost:8980/orders/"

export function getOrders(successCB) {
    axios.get(baseURL)
        .then(successCB)
}

export function updateStatus(id, status, successCB) {
    axios.patch(baseURL+id, { status: status })
      .then(successCB)
  }
